import amber from '@material-ui/core/colors/amber'

const lightTheme = {
    palette: {
        typography: {
            useNextVariants: true,
        },
        primary: amber,
        type: 'light',
        secondary: {
            main: '#5c6bc0',
            },
        },
    }


export default lightTheme
